import "./Header.css"

function Header() {
  return (
    <div className="header">
        <div className="headerTitles">
            <span className="headerTitleSm">Book Review</span>
            <span className="headerTitleLg">BLOG</span>
      </div>
      <img className="headerImg" src="" alt="" />
    </div>
  )
}

export default Header
